import React, { useState } from "react";
import { Nav } from "react-bootstrap/";
import LogoImg from "../resource/images/header_logo.png";
import BodyContainer from "./BodyContainer";
import FlexBox from "./FlexBox";

const Header = () => {
    const [tabCurrent, setTabCurrent] = useState(0);
    const headerMenu = [
        {
            index: 0,
            title: "메인",
            link: "/",
        },
        {
            index: 1,
            title: "게시판",
            subMenu: [
                { index: 0, subTitle: "자유" },
                { index: 1, subTitle: "서울" },
                { index: 2, subTitle: "부산" },
                { index: 3, subTitle: "울산" },
                { index: 4, subTitle: "경남" },
            ],
            link: "/board",
        },
        {
            index: 2,
            title: "자취생활",
            subMenu: [
                { index: 0, subTitle: "청소" },
                { index: 1, subTitle: "세탁" },
                { index: 2, subTitle: "요리" },
                { index: 3, subTitle: "건강" },
                { index: 4, subTitle: "기타" },
            ],
            link: "/life",
        },
    ];

    return (
        <BodyContainer className="border-b-[1px] bg-white">
            <FlexBox justify="space-between" className="h-[60px] md:h-[100px]">
                <FlexBox className="h-full">
                    <img src={LogoImg} alt="" className="h-[40px] md:h-[70px] md:pr-8" />
                    <Nav
                        className="flex h-full"
                        // onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
                    >
                        {headerMenu.map((item, index) => (
                            <Nav.Item key={index}>
                                <Nav.Link href={item.link}>{item.title}</Nav.Link>
                            </Nav.Item>
                        ))}
                        <Nav.Item>
                            <Nav.Link href="/home" eventKey="disabled">
                                Active
                            </Nav.Link>
                        </Nav.Item>
                        {/* eventKey="disabled" */}
                    </Nav>
                </FlexBox>
                <div>qdqd</div>
            </FlexBox>
        </BodyContainer>
    );
};

export default Header;
